import './body.css';

const Body=()=>{
    return(
        <div>
            <div className="image">
                <img src="https://meme-token-gilt.vercel.app/assets/uranus-BetmuAOr.jpeg" alt="image" />
            </div>
            
            <div className="content">
                <h2>Heading</h2>
                <p>Description goes here...</p>
            </div>
        </div>
    );
};

export default Body;
